import Home from './pages/Home';
import { BrowserRouter, Routes, Route, Router } from "react-router-dom";

function App() {
  return (<BrowserRouter>
            <div>
              <Routes>
                <Route path='/' element={<Home/>} />
              </Routes>
            </div>
          </BrowserRouter>
  );
}

export default App;
